import React from 'react';
import Nav from '../Nav';

function Header(props) {
    const { setHomeState, activeState, setActiveState } = props;

    return (
        <header>
            < Nav 
            setHomeState={setHomeState}
            activeState={activeState}
            setActiveState={setActiveState}
            />
        </header>
    )
}

export default Header;
